import { BrowserRouter, Route, Routes } from "react-router-dom";
import React from "react";
import Login from './pages/Login'
import Home from "./pages/Home";
import ForgotPassWord from "./pages/ForgotPassWord";
import Product from "./pages/Product";
import Service from "./pages/Service";
import Information from "./pages/Information";
import PageQuanTri from "./pages/PageQuanTri";
import FormBooking from "./components/FormBooking";
import Discount from "./pages/Discount";
import Register from "./pages/Register";
import Sidebar from "./components/Sidebar";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/forgotpassword" element={<ForgotPassWord />} />
          <Route path="/sanpham" element={<Product />} />
          <Route path="/dichvu" element={<Service />} />
          <Route path="/gioithieu" element={<Information />} />
          <Route path="/pagequantri" element={<PageQuanTri />} />
          <Route path="/dat-lich" element={<FormBooking />} />
          <Route path="/khuyenmai" element={<Discount />} />
          <Route path="/sidebar" element={<Sidebar />} />



        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
